import { registerIcon } from "@ui5/webcomponents-base/dist/asset-registries/Icons.js";
import { ICON_FILTER } from "../generated/i18n/i18n-defaults.js";

const name = "filter";
const pathData = "M507.4 50c7 12 4 25 0 31l-153 214v118c0 13-9 22-19 29l-127 64c-10 6-23 6-32 0-10-7-16-16-16-29V295L7.4 81c-7-9-10-22-3-31 6-10 16-16 28-16h447c13 0 22 6 28 16zm-213 220l121-173h-322l124 173c3 6 7 12 7 19v140l63-32V289c0-7 4-13 7-19z";
const ltr = false;
const accData = ICON_FILTER;
const collection = "SAP-icons-v5";
const packageName = "@ui5/webcomponents-icons";

registerIcon(name, { pathData, ltr, accData, collection, packageName });

export default { pathData, accData };
